// App.js
import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { useKeycloak } from '@react-keycloak/web';
import Login from './components/Login';
import Register from './components/Register';
import ChatLayout from './components/ChatLayout';
import ApiDocumentation from './components/ApiDocumentation';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import keycloak from './keycloak'; // Import Keycloak instance

const theme = createTheme({
    palette: {
        mode: 'dark',
        primary: {
            main: '#1976d2',
        },
        secondary: {
            main: '#f50057',
        },
    },
});

function App() {
    const [keycloakInitialized, setKeycloakInitialized] = useState(false);

    // Initialize Keycloak
    useEffect(() => {
        keycloak.init({ onLoad: 'login-required' }).then(authenticated => {
            setKeycloakInitialized(authenticated);
        }).catch(e => {
            console.error('Keycloak initialization failed', e);
        });
    }, []);

    if (!keycloakInitialized) {
        return <div>Loading...</div>; // Or a loading spinner
    }

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Router>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/api-docs" element={<ApiDocumentation />} />
                    <Route
                        path="/chats"
                        element={
                            <ProtectedRoute>
                                <ChatLayout />
                            </ProtectedRoute>
                        }
                    />
                    <Route path="/" element={<Navigate to="/chats" replace />} />
                </Routes>
            </Router>
        </ThemeProvider>
    );
}

function ProtectedRoute({ children }) {
    const { keycloak } = useKeycloak();
    return keycloak.authenticated ? children : <Navigate to="/login" replace />;
}

export default App;
